import { useEffect, useState } from "react";
import StockWidget from "../../../widget/stockgraph/StockWidget";
import AutoComplete from "../../test/test";
import styles from "./Content.module.css";
import ContentContainer from "./ContentContainer";

// prettier-ignore
const data = `{
  "symbols":[["Apple", "AAPL|1D"],
  ["Google", "GOOGL|1D"]
  ],
  "chartOnly": false,
  "width": "700",
  "height": "450",
  "locale": "en",
  "colorTheme": "dark",
  "autosize": false,
  "showVolume": false,
  "showMA": false,
  "hideDateRanges": false,
  "hideMarketStatus": false,
  "hideSymbolLogo": false,
  "scalePosition": "right",
  "scaleMode": "Normal",
  "fontFamily": "-apple-system, BlinkMacSystemFont, Trebuchet MS, Roboto, Ubuntu, sans-serif",
  "fontSize": "10",
  "noTimeScale": false,
  "valuesTracking": "1",
  "changeMode": "price-and-percent",
  "chartType": "line",
  "maLineColor": "#2962FF",
  "maLineWidth": 1,
  "maLength": 9
}`;

export default function Content(props) {
  const [qeustion, setQeustion] = useState("");
  const [stockData, setStockData] = useState(data);

  const handleSubmit = (e) => {
    e.preventDefault();
    // 서버로 보내는 로직 하나
    setQeustion("");
  };

  const PushData = () => {
    let JsonData = JSON.parse(stockData);
    JsonData.symbols.push(["Microsoft", "MSFT|1D"]);
    let LastData = JSON.stringify(JsonData);
    setStockData(LastData);
  };

  console.log(stockData);

  return (
    <div className={styles.main}>
      <ContentContainer />
    </div>
  );
}
